import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { createWebinarRegistration } from '../services/webinar';
import { openRazorpayCheckout } from '../services/razorpay';
import { webinarApi } from '../services/webinarApi';

const WebinarRegister = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({ 
    name: '', 
    email: '', 
    phone: '', 
    experience: '', 
    goals: '' 
  });
  const [submitting, setSubmitting] = useState(false);
  const serverBaseUrl = process.env.REACT_APP_SERVER_URL || 'http://localhost:5000';

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const onSubmit = async (e) => {
    e.preventDefault();
    setSubmitting(true);
    try {
      // Create order via new API endpoint
      const response = await fetch(`${serverBaseUrl}/api/webinar/register`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          name: form.name,
          email: form.email,
          phone: form.phone,
          experience: form.experience,
          goals: form.goals
        })
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.error || 'Failed to create order');
      }

      const { orderId, amount } = await response.json();

      await openRazorpayCheckout({
        name: form.name,
        email: form.email,
        phone: form.phone,
        experience: form.experience,
        goals: form.goals,
        amount: amount / 100, // Convert from paise to rupees
        onSuccess: async (resp) => {
          const verifyResponse = await fetch(`${serverBaseUrl}/api/webinar/verify`, {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({
              orderId: resp.razorpay_order_id,
              paymentId: resp.razorpay_payment_id,
              signature: resp.razorpay_signature,
              name: form.name,
              email: form.email,
              phone: form.phone,
              experience: form.experience,
              goals: form.goals
            })
          });

          if (!verifyResponse.ok) {
            throw new Error('Payment verification failed');
          }

          const result = await verifyResponse.json();
          if (result.message) {
            navigate('/webinar/success?ref=' + resp.razorpay_payment_id);
          } else {
            alert('Payment signature verification failed.');
          }
        },
        onFailure: async () => {
          alert('Payment failed. Please try again.');
        },
      });
    } catch (err) {
      console.error(err);
      alert('Registration failed: ' + err.message);
    } finally {
      setSubmitting(false);
    }
  };

  return (
    <section className="webinar-register">
      <div className="container">
        <h1 className="section-title">Register for Vibe Coding Webinar</h1>
        <p style={{ textAlign: 'center', marginBottom: '1rem' }}>22 September, 7:00 PM IST â€¢ Fee: â‚¹99</p>
        <form className="contact-form" onSubmit={onSubmit}>
          <div className="form-group">
            <input name="name" value={form.name} onChange={handleChange} type="text" placeholder="Your Name" required />
          </div>
          <div className="form-group">
            <input name="email" value={form.email} onChange={handleChange} type="email" placeholder="Your Email" required />
          </div>
          <div className="form-group">
            <input name="phone" value={form.phone} onChange={handleChange} type="tel" placeholder="Phone (WhatsApp preferred)" required />
          </div>
          <div className="form-group">
            <select name="experience" value={form.experience} onChange={handleChange} required>
              <option value="">Select your coding experience</option>
              <option value="Beginner">Beginner (0-1 years)</option>
              <option value="Intermediate">Intermediate (1-3 years)</option>
              <option value="Advanced">Advanced (3+ years)</option>
            </select>
          </div>
          <div className="form-group">
            <textarea 
              name="goals" 
              value={form.goals} 
              onChange={handleChange} 
              placeholder="What do you hope to learn from this webinar?" 
              required 
              rows="3"
            />
          </div>
          <button disabled={submitting} type="submit" className="btn btn-primary">
            {submitting ? 'Processing...' : 'Pay â‚¹99 & Register'}
          </button>
        </form>
        <p style={{ textAlign: 'center', marginTop: '1rem', color: '#666' }}>
          Secure payment via Razorpay. Confirmation sent to your email.
        </p>
      </div>
    </section>
  );
};

export default WebinarRegister;
